== 简介 ==

'''{{lj|MY舞☆TONIGHT}}'''是TV动画《[[LoveLive!Sunshine!!]]》二期第三话插曲，由[[Aqours]]演唱。本曲所在的专辑《[[MY舞 TONIGHT／MIRACLE WAVE|{{lj|MY舞☆TONIGHT／MIRACLE WAVE}}]]》于2017年11月29日发售。

英文“MY”和日文“{{ruby|舞|まい|ja}}”同音。

{{黑幕|絕對沒有在暗示跟洗衣機有關的音G。}}
{{黑幕|而且为什么这歌一些地方的BGM和[[我们是未来之花]]这么像啊……}}

Aqours第一首和風搖滾的作品。

