==== Hard 难度 ====
一个极其难的7星曲目，实际难度8星上位，不要被物料欺骗了。

{{黑幕|[[Anemone heart|某8星的Normal]]哭晕在厕所}}

应对方法：调速吧！

==== 打击爽快的EX 难度 ====
开头没有被神剪辑，可以说是本曲的福音。

全谱的各处交互速度快而富有节奏感，要注意对其的把控。

副歌快速的开花、副歌前和副歌中大量的大阶梯再加長條，再加上结尾前的快速单侧单点，可谓是不容小觑的一张谱。{{黑幕|大阶梯那么多，还说没暗示某像洗衣机一样的音G？}}

